    description: >-
      A set of branded signs as commonly seen from the interstate, especially in many rural and suburban highway exits.


      Personally I use the hotel brands with @RebaLynnTS's Modular Motel System, and pair them with @kingofsimcity's modular parking that use @shokthrpy's parking pack textures, hence why the hotel
      brands have a pavement texture instead of a grass texture. I also have the lots and props in separate folders in case you don't want to use the lots, considering they do add a bunch of entries
      to the parks menu in-game.


      Dependencies:

      PC Mega Props Vol. 1

      SHK Parking Pack


      There are 74 signs included, including some brands that don't have existing buildings on here.

